import React from 'react';
import Layout from '../components/Layout'
const NuevoCliente = () => {
    return (  
        <Layout>
            <h1 className='text-2xl text-gray-800 font-light'>Nuevo Cliente</h1>
        </Layout>
    );
}
 
export default NuevoCliente;
